  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas
  ). The Austin, TX EnviroAtlas One Meter-scale Urban Land Cover (MULC) Data were
  generated from United States Department of Agriculture (USDA) National Agricultural
  Imagery Program (NAIP) four band (red, green, blue, and near infrared) aerial photography
  at 1 m spatial resolution from multiple dates in May, 2010. Six land cover classes
  were mapped: water, impervious surfaces, soil and barren land, trees, grass-herbaceous
  non-woody vegetation, and agriculture. An accuracy assessment of 600 completely
  random and 55 stratified random photo interpreted reference points yielded an overall
  User's fuzzy accuracy of 87 percent. The area mapped is the US Census Bureau's 2010
  Urban Statistical Area for Austin, TX plus a 1 km buffer. This dataset was produced
  by the US EPA to support research and online mapping activities related to EnviroAtlas.
  EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to interact with a
  web-based, easy-to-use, mapping application to view and analyze multiple ecosystem
  services for the contiguous United States. The dataset is available as downloadable
  data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map
  service. Additional descriptive information about each attribute in this dataset
  can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
